import React from 'react';

const MarqueeLiveStream = () => (
        /* Section: We are Live Now */
        <div className="l-section l-watch">
        <div className="l-container c-live">
          <div className="c-live__on"></div>
          <div className="c-live__title">
            <a href="#" className="h-nolink w-inline-block">
              <div><strong>We are live</strong> Watch Now</div>
            </a>
          </div>
        </div>
      </div>
);

export default MarqueeLiveStream;
